import React, { useState, useEffect } from 'react';
import { Box, Button, TextField, Typography, Paper } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Auth() {
  const [isLogin, setIsLogin] = useState(true); // State untuk menentukan form Login atau Register
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [error, setError] = useState(''); // State untuk error message
  const navigate = useNavigate();

  useEffect(() => {
    // Mengecek apakah pengguna sudah login berdasarkan status di localStorage
    const isLoggedIn = localStorage.getItem('isLoggedIn');
    if (isLoggedIn) {
      navigate('/diagnosis'); // Arahkan ke halaman diagnosis jika sudah login
    }
  }, [navigate]);

  // Fungsi untuk menangani submit login
  const handleLoginSubmit = async (e) => {
    e.preventDefault();
    
    // Validasi input
    if (!email || !password) {
      setError('Email dan password harus diisi');
      return;
    }

    // Panggil API login (Simulasi)
    const isValidEmail = email.match(/^[\w-]+(\.[\w-]+)*@([\w-]+\.)+[a-zA-Z]{2,7}$/);
    const isValidPassword = password.length >= 6; // Misalnya password minimal 6 karakter

    if (!isValidEmail || !isValidPassword) {
      setError('Email atau password tidak valid');
      return;
    }

    // Proses autentikasi (ganti dengan pemanggilan API sebenarnya)
    const response = await mockLoginApi(email, password);
    
    if (response.success) {
      localStorage.setItem('isLoggedIn', 'true');
      navigate('/diagnosis');
    } else {
      setError('Login gagal. Periksa email dan password');
    }
  };

  // Fungsi untuk menangani submit register
  const handleRegisterSubmit = async (e) => {
    e.preventDefault();

    // Validasi input
    if (!name || !email || !password) {
      setError('Semua field harus diisi');
      return;
    }

    // Proses registrasi (ganti dengan pemanggilan API sebenarnya)
    const response = await mockRegisterApi(name, email, password);

    if (response.success) {
      navigate('/login'); // Arahkan ke halaman login setelah registrasi
    } else {
      setError('Registrasi gagal. Coba lagi nanti');
    }
  };

  // Simulasi panggilan API login
  const mockLoginApi = (email, password) => {
    return new Promise((resolve) => {
      setTimeout(() => {
        if (email === 'test@example.com' && password === 'password123') {
          resolve({ success: true });
        } else {
          resolve({ success: false });
        }
      }, 1000);
    });
  };

  // Simulasi panggilan API registrasi
  const mockRegisterApi = (name, email, password) => {
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve({ success: true });
      }, 1000);
    });
  };

  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
        backgroundColor: '#f7f7f7',
      }}
    >
      <Paper
        sx={{
          padding: 3,
          width: 400,
          textAlign: 'center',
          borderRadius: '8px',
          boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
        }}
      >
        <Typography variant="h5" sx={{ mb: 2, fontWeight: 'bold', color: '#333' }}>
          {isLogin ? 'Login' : 'Register'}
        </Typography>

        {error && (
          <Typography variant="body2" sx={{ color: 'red', marginBottom: 2 }}>
            {error}
          </Typography>
        )}

        {/* Form Login */}
        {isLogin ? (
          <form onSubmit={handleLoginSubmit}>
            <TextField
              label="Email"
              type="email"
              fullWidth
              required
              margin="normal"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': {
                  borderRadius: '20px',
                },
              }}
            />
            <TextField
              label="Password"
              type="password"
              fullWidth
              required
              margin="normal"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': {
                  borderRadius: '20px',
                },
              }}
            />
            <Button
              type="submit"
              variant="contained"
              fullWidth
              sx={{
                mt: 2,
                borderRadius: '20px',
                backgroundColor: '#3f51b5',
                '&:hover': {
                  backgroundColor: '#303f9f',
                },
              }}
            >
              Login
            </Button>
          </form>
        ) : (
          /* Form Register */
          <form onSubmit={handleRegisterSubmit}>
            <TextField
              label="Full Name"
              type="text"
              fullWidth
              required
              margin="normal"
              value={name}
              onChange={(e) => setName(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': {
                  borderRadius: '20px',
                },
              }}
            />
            <TextField
              label="Email"
              type="email"
              fullWidth
              required
              margin="normal"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': {
                  borderRadius: '20px',
                },
              }}
            />
            <TextField
              label="Password"
              type="password"
              fullWidth
              required
              margin="normal"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': {
                  borderRadius: '20px',
                },
              }}
            />
            <Button
              type="submit"
              variant="contained"
              fullWidth
              sx={{
                mt: 2,
                borderRadius: '20px',
                backgroundColor: '#3f51b5',
                '&:hover': {
                  backgroundColor: '#303f9f',
                },
              }}
            >
              Register
            </Button>
          </form>
        )}

        {/* Toggle between Login and Register */}
        <Box sx={{ mt: 2 }}>
          <Typography variant="body2" sx={{ color: '#555' }}>
            {isLogin ? "Don't have an account?" : "Already have an account?"}{' '}
            <Button onClick={() => setIsLogin(!isLogin)} sx={{ textTransform: 'none', color: '#3f51b5' }}>
              {isLogin ? 'Register here' : 'Login here'}
            </Button>
          </Typography>
        </Box>
      </Paper>
    </Box>
  );
}

export default Auth;
